import React from 'react';
import logo from './logo.svg';
import './App.css';

function Date() {
  const date = new Date();
  const hour = date.getHours();
  let time

  if (hours < 12) {
    time = "Good Morning! How would you like to get started today?"

  } else if (hours > 17) {
    time = "Reflect on what you have accomplished today. Sweet dreams!"    
  } else {
    time = "Good Afternoon! Keep going, you're doing a great job so far."
  }


  return (
    <div>
      <h1 className="App-header">
        {date}
      </h1>
      <p>
      {time}
      </p>
    </div>
  );
}

export default Date;
